import React from "react";
import "./Navbar.css"
function Navbar() {

  const[menu,setMenu]=useS
  return (
    <>
      <div className="Navbar">
        <ul className="nav-menu">
          <li>Home</li>
          <li>About Me</li>
          <li>Services</li>
          <li>Portfolio</li>
          <li>Contact</li>
        </ul>
        <div className="nav-conect">Connect With Me</div>
      </div>
    </>
  );
}

export default Navbar;
